pragma solidity ^0.8.0;

contract Lottery {
    address payable[] public players; // dynamic array of players
    address public manager; // address of the manager
    uint public entryFee; // entry fee in wei
    uint public minimumPlayers; // minimum number of players required
    uint public winnerIndex; // index of the winner
    
    constructor(uint _entryFee, uint _minimumPlayers) {
        manager = msg.sender;
        entryFee = _entryFee;
        minimumPlayers = _minimumPlayers;
    }
    
    function enter() public payable {
        require(msg.value == entryFee, "Please send the correct entry fee.");
        require(players.length < 10, "Maximum number of players reached.");
        players.push(payable(msg.sender));
    }
    
    function pickWinner() public restricted {
        require(players.length >= minimumPlayers, "Not enough players to pick a winner.");
        winnerIndex = random() % players.length;
        players[winnerIndex].transfer(address(this).balance);
        players = new address payable[](0); // reset the players array
    }
    
    function random() private view returns (uint) {
        return uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp, players.length)));
    }
    
    modifier restricted() {
        require(msg.sender == manager, "Only the manager can pick a winner.");
        _;
    }
}

